  - name: TEXT4000
    number: '6'
    value: 'Upon further reconciliation of activity during the reporting period, we
      identified the following changes on the July Monthly report and submit this
      amended report to reflect these changes:  Or amended report reflects contributions
      itemized on Line 11a $225, an additional transfer of allocated nonfederal funds
      for payroll in the amount of $4822.74 on Schedule H3, the elimination of an
      offset to operating expenditure in the amount of $873.17 originally reported
      on Line 15, which upon further review was identified as a transfer from one
      federal account to another, and a transfer to affiliated committee in the amount
      of $2,500 inadvertently omitted.  Finally, interest earned on Levin Funds was
      overstated by $.15 and has been corrected.  The net change in cash on hand was
      an increase in the amount of $1,674.57.  Schedule B, Line 21(b) reports reimbursements
      for travel expenses which are not itemized because they do not exceed the $200
      itemization level and do not exceed the $200 aggregate per vendor amount.  With
      respect to the expenditures made by the Party for payroll, payroll taxes, and
      other payroll or employee benefit-related expenses, the Party adheres to 11
      CFR 300.33, and also follows the Commissions revision of the rules as adopted
      on December 1, 2005. Specifically, the Party pays for these costs with 100%
      federal funds when the employee spends more than 25 percent of his or her time
      in a month on federal election activity (FEA) or activity in connection with
      a federal election. These expenditures are reported on Schedule B for Line 30b.  Alternatively,
      when an employee does not meet the 25 percent threshold, the Party allocates
      these costs as an overhead/administrative expense, and reports these disbursements
      on a Schedule H4 for Line 21a.'
